module.exports = /*#__PURE__*/JSON.parse('{"tag":{"label":"Java","permalink":"/ja/tags/java","allTagsPath":"/ja/tags","count":108,"items":[{"id":"java/set-receive-event","title":"警告通知の受信設定","description":"プロジェクトに含まれるメンバーの警告通知の受信に関連した各種機能を設定できます。","permalink":"/ja/java/set-receive-event"},{"id":"kubernetes/install-application-agent","title":"管理 > アプリケーションエージェントのインストール","description":"コンテナ内のJava、Python、Node.jsなどのアプリケーションをモニタリングするためのエージェントをインストールする過程です。","permalink":"/ja/kubernetes/install-application-agent"},{"id":"java/topology-basic","title":"基本的な使い方","description":"トポロジーメニューで基本的な作業を行う方法について説明します。","permalink":"/ja/java/topology-basic"},{"id":"java/agent-additional-option","title":"付加機能","description":"Javaアプリケーションのモニタリングレベルをユーザーのニーズに合わせて調整できる追加のエージェント設定オプションを案内します。SQLパラメータの収集、HTTPパラメータとヘッダ情報の収集、ユーザーIP情報の抽出、ユーザー数の追跡方法の選択、SAP Functionの追跡などを含みます。これらのオプションにより、より詳細なデータ収集と分析が可能になり、特にセキュリティが重要な環境で必要に応じてオプションを調整できます。","permalink":"/ja/java/agent-additional-option"},{"id":"java/topology-add-function","title":"付加機能","description":"トポロジーメニューから使用できるアドオンについて説明します。","permalink":"/ja/java/topology-add-function"},{"id":"java/agent-load-amount","title":"負荷制御","description":"Javaアプリケーションサーバーのトラフィックスロットリングオプションを設定するエージェントオプションを案内します。アプリケーションの最大同時リクエスト数を制限し、特定のユーザーまたはURLに基づいてサービスへのアクセスを制御する機能を含めます。ユーザー定義型メッセージの送信、URLリダイレクト設定、イベント通知の活性化など、様々なオプションを提供し、過負荷状況でのアプリケーションの安定性を保障できます。","permalink":"/ja/java/agent-load-amount"},{"id":"java/analysis-report-intro","title":"分析","description":"Java環境のアプリケーション性能を分析し、発生する可能性がある問題に対応できます。","permalink":"/ja/java/analysis-report-intro"},{"id":"java/async-tracking","title":"非同期追跡","description":"Javaエージェント設定を介して非同期アプリケーション活動を追跡する方法を案内します。 CompletableFutureメソッドの収集方法と、ユーザーアプリケーションにそのメソッドをhookingする方法が含まれます。 設定例とともにwhatap.confファイルに追加すべきオプションを提供し、非同期呼び出しの性能モニタリングを強化できるようにサポートします。","permalink":"/ja/java/async-tracking"},{"id":"java/flexboard-template","title":"事前テンプレートの適用","description":"Flexボードでユーザー定義型のダッシュボードをすばやく構成できるよう事前に設定されたテンプレートを案内します。ユーザーは初期設定を簡単に行い、必要に応じて設定を変更して活用できます。テンプレートの選択から名前付け、レイアウトの調整、保存に至るまでの手順を確認し、ユーザーは効果的にモニタリングダッシュボードを作成できます。","permalink":"/ja/java/flexboard-template"},{"id":"java/performance-trend","title":"性能推移","description":"性能推移について案内します。","permalink":"/ja/java/performance-trend"},{"id":"java/set-event-detect-anomal","title":"異常値検知の警告通知","description":"予期しないパターンを検出する一連の動作を検知し、警告通知を送信するように設定できます。","permalink":"/ja/java/set-event-detect-anomal"},{"id":"java/application-daily-stat","title":"日付別のアプリケーション状況","description":"Java環境のアプリケーションで日別の主要指標の現況を時間帯別に確認することができます。","permalink":"/ja/java/application-daily-stat"},{"id":"java/agent-static","title":"統計","description":"Javaアプリケーションモニタリングのための様々な統計収集機能関連エージェントオプションをご案内します。性能カウンタの拡張、ドメイン別トランザクションの収集、マルチサーバートランザクションの依存性分析、ログインタイプ別及びRefererer別の統計収集などが含まれます。また、SQL、HTTP Call、エラー統計とユーザエージェント情報収集の最大レコード数制限設定も確認できます。","permalink":"/ja/java/agent-static"},{"id":"java/analysis-apm-trs","title":"統計","description":"Javaアプリケーション環境で収集した様々な指標から統計情報を提供します。","permalink":"/ja/java/analysis-apm-trs"},{"id":"java/integrated-report","title":"統合レポート","description":"統合レポートについて説明します。","permalink":"/ja/java/integrated-report"},{"id":"java/aes-256-encryption","title":"AES256暗号化","description":"Javaエージェントが収集したデータをサーバーに送信する時に使用する暗号化方法を案内します。XOR演算とAES暗号化を使用してデータセキュリティを強化し、128ビットを基本的に対応していますが、AES 256ビット暗号化を適用するためにはJava Cryptography Extension(JCE)をアップデートする必要があります。","permalink":"/ja/java/aes-256-encryption"},{"id":"java/hitmap-notice","title":"AIを利用したのヒットマップパターンのアラート通知","description":"アプリケーションの実行の分布パターンをマシンラーニングを通じて自動的に認識し、アラート通知を送信します。","permalink":"/ja/java/hitmap-notice"},{"id":"java/agent-apdex","title":"Apdex","description":"ユーザー満足度を測定するApdexスコアを設定するJavaエージェントオプションを案内します。Apdex指標を通じてアプリケーションの性能を客観的に評価し、ユーザー体験を改善できます。","permalink":"/ja/java/agent-apdex"},{"id":"java/agent-usage","title":"CPU／メモリ／ディスク使用量の収集","description":"JavaエージェントがCPU、メモリ、ディスク使用量を収集する方法を案内します。JavaのJMXライブラリを基本的に活用し、必要に応じてLinuxのprocディレクトリやoshi、sigarライブラリによる性能指標の収集方法を確認できます。","permalink":"/ja/java/agent-usage"},{"id":"java/agent-dbsql","title":"DB、SQL","description":"データベース及びSQL性能データ収集のためのJavaエージェントの様々なオプションを案内します。DBCP、Hikari、Tomcatなど様々なDB接続プール(Connection Pool)情報の追跡及びSQL実行の詳細を記録できます。また、SQLパラメータ情報の記録、DB接続漏れの追跡など、性能最適化に欠かせない情報収集オプションを提供します。","permalink":"/ja/java/agent-dbsql"},{"id":"java/add-jvm-opt/docker","title":"Docker","description":"ドッカー(Docker)環境でJavaアプリケーションにWhaTap Javaモニタリングエージェントを適用する手順を案内します。ユーザーは、既存のDockerのイメージにWhaTap Javaエージェント設定を追加して新しいイメージをビルドする手順、whatap.confファイルの作成、Dockerfileの作成、JAVA_OPTの修正方法などを確認できます。また、Java 17以降のバージョンで必要な追加JVMオプションと様々なJavaバージョンによるヒープ・ヒストグラムの照会設定方法も案内します。","permalink":"/ja/java/add-jvm-opt/docker"},{"id":"kubernetes/install-docker-java","title":"Docker Javaインストール","description":"コンテナ内のJavaアプリケーションをモニタリングするためにエージェントをインストール段階です。","permalink":"/ja/kubernetes/install-docker-java"},{"id":"java/add-jvm-opt/elastic-beanstalk","title":"Elastic Beanstalk","description":"AWS Elastic Beanstalk環境でJavaアプリケーションを実行するユーザーが、WhaTapのJavaモニタリングエージェントを効果的に適用するためのJVMオプションを設定する方法を案内します。Elastic Beanstalkに合わせたWhaTap Javaエージェントのインストールと構成過程、必須JVMオプションの追加及び設定方法を確認することができます。 さらに、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/elastic-beanstalk"},{"id":"java/flex-board","title":"Flexボード","description":"ユーザー定義型の統合ダッシュボードを案内します。ユーザーは、アプリケーション、サーバー、データベース、コンテナなどのデータでリアルタイムのダッシュボードを作成できます。事前に構成されたテンプレートを提供し、様々なデータウィジェットの追加、データフィルタリング、時間範囲の設定などの機能により、ユーザーが希望するモニタリング対象を簡単に要約し、重要データを確認できます。","permalink":"/ja/java/flex-board"},{"id":"java/flexboard-share","title":"Flexボード共有","description":"Flexボードを他のアカウントのユーザーと共有または再利用できます。","permalink":"/ja/java/flexboard-share"},{"id":"java/flexboard-manage","title":"Flexボード管理","description":"Flexボードでダッシュボードを編集し管理する方法を案内します。ダッシュボードの名前変更、プロジェクト選択、レイアウト調整などを含み、ウィジェットの追加、移動、サイズ調整、削除方法も確認できます。また、ウィジェットのデータソースを選択する方法と、ダッシュボードのjson形式への書き出し機能も提供します。","permalink":"/ja/java/flexboard-manage"},{"id":"java/flexboard-mode","title":"Flexボード画面モード","description":"Flexボードの画面モードに応じて提供する機能について案内します。","permalink":"/ja/java/flexboard-mode"},{"id":"java/flexboard-create","title":"Flexボードの作成","description":"Flexボードメニューでダッシュボードを作成し、ウィジェットを配置してユーザー定義型のダッシュボードを作成する手順を案内します。固定レイアウトと反応型レイアウトの中から選択することができ、メトリクスウィジェットの追加及び事前に定義されたウィジェットテンプレートを活用することができます。ユーザーはウィジェットの位置を調整し、サイズを変更して独自のダッシュボードレイアウトを完成できます。","permalink":"/ja/java/flexboard-create"},{"id":"java/agent-httpcapicall","title":"HTTPC, API Call","description":"HTTP外部呼び出しとAPI呼び出し関連データの収集、分析するためのJavaエージェントのオプション設定方法を案内します。TOO SLOWエラー処理及びCPUとメモリ使用量の追跡、呼び出し時点のスタックトレース記録、URL正規化など、細かいモニタリングのための様々なオプションを提供します。これにより開発者は、アプリケーションの外部依存性を効率的に管理し、性能問題を識別できます。","permalink":"/ja/java/agent-httpcapicall"},{"id":"java/add-jvm-opt/ibm-bluemix","title":"IBM BlueMix","description":"IBM BluemixクラウドプラットフォームでJavaアプリケーションを実行するユーザーが、WhaTapのJavaモニタリングエージェントを効果的に適用するためのJVMオプションを設定する方法についてご案内します。ユーザーはこの文書を通じてIBM Bluemix環境でWhaTapのJavaエージェントをインストールしてからエージェントを構成する過程、必要なJVMオプションの追加方法を段階別に確認できます。さらに、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/ibm-bluemix"},{"id":"log/log-java","title":"Java","description":"Javaアプリケーションでログを収集する方法について案内します。","permalink":"/ja/log/log-java"},{"id":"java/add-jvm-opt/java-under-ver","title":"Java 1.6バージョン未満","description":"Java 1.6バージョン未満でJavaエージェントを適用する方法を案内します。Java 1.5と1.4バージョンそれぞれについてエージェントのインストールと設定手順、そして-javaagentオプションに関する制約事項を確認できます。","permalink":"/ja/java/add-jvm-opt/java-under-ver"},{"id":"java/introduction","title":"Javaモニタリング","description":"Java環境で動作するすべてのアプリケーションサーバーをモニタリングできます。この文書は、Javaモニタリング製品に対する紹介ページです。","permalink":"/ja/java/introduction"},{"id":"java/add-jvm-opt/jboss","title":"JBoss","description":"WhaTapモニタリングソリューションをJBossアプリケーションに統合するためのJVM(Java Virtual Machine) オプションの追加方法についての詳細な案内を提供します。ユーザーは本文書を通じて、Javaエージェントのインストール後、JBossアプリケーションの性能および可用性モニタリングのために必要なJVM設定を適用する方法を段階別に確認することができます。エージェントのインストール過程の中で必須JVMオプションの構成とJBossとの円滑な統合のための最適な設定方法、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/jboss"},{"id":"java/add-jvm-opt/jetty","title":"Jetty","description":"WhaTapモニタリングソリューションをJettyアプリケーションに統合するためのJVM(Java Virtual Machine) オプションの追加方法についての詳細な案内を提供します。ユーザーは本文書を通じて、Javaエージェントのインストール後、Jettyアプリケーションの性能および可用性モニタリングのために必要なJVM設定を適用する方法を段階別に確認することができます。エージェントのインストール過程の中で必須JVMオプションの構成とJettyとの円滑な統合のための最適な設定方法、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/jetty"},{"id":"java/add-jvm-opt/jeus","title":"JEUS","description":"WhaTapモニタリングソリューションをJEUSアプリケーションに統合するためのJVM(Java Virtual Machine) オプションの追加方法についての詳細な案内を提供します。ユーザーは本文書を通じて、Javaエージェントのインストール後、JEUSアプリケーションの性能および可用性モニタリングのために必要なJVM設定を適用する方法を段階別に確認することができます。エージェントのインストール過程の中で必須JVMオプションの構成とJEUSとの円滑な統合のための最適な設定方法、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/jeus"},{"id":"kubernetes/set-agent","title":"Kubernetesエージェントオプション設定","description":"コンテナ内のアプリケーションをモニタリングするために必要な設定をwhatap.confファイルに作成します。 設定できるオプションについて調べます。","permalink":"/ja/kubernetes/set-agent"},{"id":"java/add-jvm-opt/liberty","title":"Liberty","description":"WhaTapモニタリングソリューションをLibertyアプリケーションに統合するためのJVM(Java Virtual Machine) オプションの追加方法についての詳細な案内を提供します。ユーザーは本文書を通じて、Javaエージェントのインストール後、Libertyアプリケーションの性能および可用性モニタリングのために必要なJVM設定を適用する方法を段階別に確認することができます。エージェントのインストール過程の中で必須JVMオプションの構成とLibertyとの円滑な統合のための最適な設定方法、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/liberty"},{"id":"java/analysis-msa","title":"MSA分析","description":"MSA分析機能は、WhaTapのMTRACE(マルチサーバー追跡)機能を使用して収集されたトランザクション間の呼び出しの割合を分析します。","permalink":"/ja/java/analysis-msa"},{"id":"java/msa-group","title":"MSA業務グループの区分","description":"Auto Scale Out環境で自動登録されたJavaエージェントを業務単位で簡単に識別できるように、okind JVMオプションを使用できます。特に、Docker環境でのエージェント管理に有用なこの設定は、エージェントの役割や所属するサービスグループを区分するのに有用です。","permalink":"/ja/java/msa-group"},{"id":"java/add-jvm-opt/play2","title":"Play2","description":"WhaTapモニタリングソリューションをPlay2アプリケーションに統合するためのJVM(Java Virtual Machine) オプションの追加方法についての詳細な案内を提供します。ユーザーは本文書を通じて、Javaエージェントのインストール後、Play2アプリケーションの性能および可用性モニタリングのために必要なJVM設定を適用する方法を段階別に確認することができます。エージェントのインストール過程の中で必須JVMオプションの構成とPlay2との円滑な統合のための最適な設定方法、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/play2"},{"id":"java/add-jvm-opt/resin","title":"Resin","description":"WhaTapモニタリングソリューションをResinアプリケーションに統合するためのJVM(Java Virtual Machine) オプションの追加方法についての詳細な案内を提供します。ユーザーは本文書を通じて、Javaエージェントのインストール後、Resinアプリケーションの性能および可用性モニタリングのために必要なJVM設定を適用する方法を段階別に確認することができます。エージェントのインストール過程の中で必須JVMオプションの構成とResinとの円滑な統合のための最適な設定方法、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/resin"},{"id":"java/scale-in-auto-delete","title":"Scale Inからエージェントの自動削除","description":"Auto Scale環境で自動的に拡張されたシステムがScale Inを実行する時、Javaエージェントを自動削除する方法を案内します。エージェントは、特定のファイルを作成してSILENT_SHUTDOWNイベントをサーバーに送信し、これによってエージェントが自動的に一覧から削除されます。このプロセスにより、システムの自動縮小時点に合わせてエージェント管理が容易になり、運用者の追加介入なしにリソースを効率的に管理できます。","permalink":"/ja/java/scale-in-auto-delete"},{"id":"java/add-jvm-opt/spring-boot","title":"Spring Boot","description":"WhaTapモニタリングソリューションをSpring Bootアプリケーションに統合するためのJVM(Java Virtual Machine) オプションの追加方法についての詳細な案内を提供します。ユーザーは本文書を通じて、Javaエージェントのインストール後、Spring Bootアプリケーションの性能および可用性モニタリングのために必要なJVM設定を適用する方法を段階別に確認することができます。エージェントのインストール過程の中で必須JVMオプションの構成とSpring Bootとの円滑な統合のための最適な設定方法、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/spring-boot"},{"id":"java/add-jvm-opt/tomcat","title":"Tomcat","description":"WhaTapモニタリングソリューションをTomcatアプリケーションに統合するためのJVM(Java Virtual Machine)オプションの追加方法についての詳細な案内を提供します。ユーザーは本文書を通じて、Javaエージェントのインストール後、Tomcatアプリケーションの性能および可用性モニタリングのために必要なJVM設定を適用する方法を段階別に確認できます。エージェントのインストール過程の中で必須JVMオプションの構成とTomcatとの円滑な統合のための最適な設定方法、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/tomcat"},{"id":"java/dashboard-transactionmap","title":"TXマップ","description":"Javaモニタリングで個別トランザクション(TX)の応答時間を分布図の形で可視化して提供するTXマップ機能を案内します。リアルタイム及び過去データの照会機能を通じてTXの詳細を分析でき、これによって問題点を識別して分析するのに役立ちます。特に、ヒットマップとは異なり、個々のTXを表示することで、より詳細に分析できます。","permalink":"/ja/java/dashboard-transactionmap"},{"id":"java/add-jvm-opt/weblogic","title":"WebLogic","description":"WhaTapモニタリングソリューションをWebLogicアプリケーションに統合するためのJVM(Java Virtual Machine) オプションの追加方法についての詳細な案内を提供します。ユーザーは本文書を通じて、Javaエージェントのインストール後、WebLogicアプリケーションの性能および可用性モニタリングのために必要なJVM設定を適用する方法を段階別に確認できます。エージェントのインストール過程の中で必須JVMオプションの構成とWebLogicとの円滑な統合のための最適な設定方法、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/weblogic"},{"id":"java/add-jvm-opt/websphere","title":"WebSphere","description":"WhaTapモニタリングソリューションをWebSphereアプリケーションに統合するためのJVM(Java Virtual Machine) オプションの追加方法についての詳細な案内を提供します。ユーザーは本文書を通じて、Javaエージェントのインストール後、WebSphereアプリケーションの性能および可用性モニタリングのために必要なJVM設定を適用する方法を段階別に確認することができます。エージェントのインストール過程の中で必須JVMオプションの構成とWebSphereとの円滑な統合のための最適な設定方法、ヒストグラムの照会方法が含まれています。","permalink":"/ja/java/add-jvm-opt/websphere"},{"id":"java/active-transactions","title":"アクティブトランザクション","description":"アクティブトランザクションを説明します。","permalink":"/ja/java/active-transactions"},{"id":"java/dashboard-active-transaction","title":"アクティブトランザクション","description":"Javaモニタリングで現在進行中のトランザクションをリアルタイムでモニタリングして分析するアクティブトランザクション機能を案内します。アプリケーションのトランザクションURL、SQL、HTTP呼び出し情報を照会し、トランザクションの状態を区分して把握することができます。これにより、遅延区間を識別し、トラブルシューティングに必要な詳細情報を取得できます。","permalink":"/ja/java/dashboard-active-transaction"},{"id":"java/warning-notice","title":"アプリケーション警告通知","description":"アプリケーションのリソース使用量および進行中トランザクション、エラー状況のイベント条件を通じて警告通知を送信します。","permalink":"/ja/java/warning-notice"},{"id":"java/metrics-performance-counter","title":"アプリケーション性能カウンター","description":"性能カウンターについて説明します。","permalink":"/ja/java/metrics-performance-counter"},{"id":"java/dashboard","title":"アプリケーションダッシュボード","description":"Javaアプリケーションの核心指標をリアルタイムでモニタリングし、過去のデータを照会できる方法を案内します。CPU、メモリ使用量、トランザクション状態などの情報を含め、問題を迅速に識別·分析できるダッシュボードの設定と使用方法を確認できます。エージェントの接続状態の確認、分類別エージェントのモニタリング、ダッシュボード ウィジェットの編集とプリセットの管理方法などが含まれています。","permalink":"/ja/java/dashboard"},{"id":"java/metrics-app","title":"アプリケーションメトリクス","description":"アプリケーションのメトリクスについて案内します。","permalink":"/ja/java/metrics-app"},{"id":"java/report-apm","title":"アプリケーションレポート","description":"アプリケーションの主要な性能に関するレポートを提供します。","permalink":"/ja/java/report-apm"},{"id":"java/set-notification-message","title":"アラートメッセージユーザーの定義","description":"プロジェクトメンバーに送信されるアラート通知メッセージを修正できるユーザー定義機能を提供します。","permalink":"/ja/java/set-notification-message"},{"id":"java/set-event-history","title":"イベント履歴","description":"イベント履歴メニューを通じて発生した警告通知の履歴が確認できます。","permalink":"/ja/java/set-event-history"},{"id":"java/warning-notice-v2","title":"イベント設定","description":"アプリケーションのリソース使用量および進行中トランザクション、エラー状況のイベント条件を通じて警告通知を送信します。","permalink":"/ja/java/warning-notice-v2"},{"id":"java/set-event-format","title":"イベント受信フォーマット","description":"アプリケーションモニタリングが提供する警告通知のイベント受信のフォーマットについて説明します。","permalink":"/ja/java/set-event-format"},{"id":"java/instance-performance-analysis","title":"インスタンスの性能管理","description":"Javaアプリケーションの環境を確認し、性能に関連する設定を確認できます。","permalink":"/ja/java/instance-performance-analysis"},{"id":"java/agent-troubleshooting","title":"インストール問題の解決","description":"Javaエージェントのインストール時に発生しうる様々な問題と、これを解決するための具体的な指針を提供します。ファイアウォールの設定、SpringBootとTomcat JMXの設定、OSGIフレームワーク使用サーバーの設定、Log ManagerとMBeanServerBuilderのエラー、Permissionのエラー、Sigarライブラリの問題など、様々な状況に対する解決策を案内します。","permalink":"/ja/java/agent-troubleshooting"},{"id":"java/install-check","title":"インストールチェックリスト","description":"Javaエージェントのインストール後に確認すべき重要な点検事項について案内します。JAVA_OPTS設定の正確性、アプリケーションサーバーの再起動の必要性、およびモニタリングサービスによるエージェント接続性の検証が含まれます。","permalink":"/ja/java/install-check"},{"id":"java/flexboard-widget-manage","title":"ウィジェットの管理","description":"Flexボードに配置するウィジェットの追加、属性の変更、コピー、削除方法を案内します。ユーザーはウィジェットの追加やウィジェットの属性変更でダッシュボードをカスタマイズできます。データ照会の条件変更、時間設定、データマージのオプションなど、細かい管理機能により、リクエストに合わせたモニタリングダッシュボードが構成できます。","permalink":"/ja/java/flexboard-widget-manage"},{"id":"java/agent-control-function","title":"エージェント機能の制御","description":"Javaアプリケーションサーバーのモニタリングのためのエージェント機能を細かく調整する方法を案内します。エージェントの活性化・非活性化、トランザクションと性能カウンターの追跡、OS情報収集などの機能を含み、各機能を制御する様々な設定オプションを確認できます。","permalink":"/ja/java/agent-control-function"},{"id":"java/agent-name","title":"エージェント名の識別","description":"モニタリング対象を区別するためのアプリケーションサーバーの固有の識別子設定について案内します。モニタリング対象システムの中からアプリケーションサーバーを正確に区別するために必須な設定です。サーバーのタイプ、IPなどの情報から自動的に名前を指定する方式と、ユーザーが直接whatap.confファイルやJVMオプションでエージェント名を設定する方法があります。","permalink":"/ja/java/agent-name"},{"id":"java/set-agent","title":"エージェント設定","description":"Javaエージェントの設定方法を案内します。whatap.confファイルによるエージェントのデフォルト設定、サーバー接続およびデータ転送設定、複数のアプリケーション サーバーの設定ファイルの管理方法などが含まれます。また、WhaTapモニタリングサービス画面で直接エージェントオプションを管理する方法も提供します。","permalink":"/ja/java/set-agent"},{"id":"java/agent-performance","title":"エージェント性能","description":"Javaエージェントの性能に関するオプションを案内します。同時に処理できる最大トランザクション数とトランザクションデータを保存するバッファの初期サイズの設定を確認できます。これは、システムの負荷とリソースの使用を最適化する重要な役割を果たします。","permalink":"/ja/java/agent-performance"},{"id":"java/agent-notification","title":"エージェント通知","description":"Javaエージェントを通じてアプリケーションサーバーで発生する様々なイベントに対する通知の設定方法を提供します。トランザクションの再帰呼び出し、サービス拒否、HTTPC接続エラー、ヒップおよびディスク使用量超過、CPU使用量しきい値到達、DBコネクション重複割り当て、例外発生時にイベント通知を設定するオプションが含まれます。各イベントごとに発行間隔、発行可否、しきい値の設定など、細かい調整ができます。","permalink":"/ja/java/agent-notification"},{"id":"java/uninstall-agent","title":"エージェントの削除とロールバック","description":"Javaエージェントを削除するか、以前のバージョンに戻す手順を案内します。エージェントを削除するときは、-javaagent JVMオプションを削除してサーバーを再起動する方法と環境変数を戻す方法を案内します。","permalink":"/ja/java/uninstall-agent"},{"id":"java/agent-network","title":"エージェントの通信設定","description":"Javaエージェントがアプリケーションサーバーから収集したデータをサーバーに転送するためのネットワーク設定方法を案内します。主な設定オプションとしては、収集サーバーホスト、ポート、タイムアウト値、ネットワーク転送サイズ、データ転送キューサイズなどがあり、エージェントの効率的なデータ管理と安定したサーバー通信を保証するために重要です。","permalink":"/ja/java/agent-network"},{"id":"java/update-agent","title":"エージェントのアップデート","description":"Javaエージェントを最新バージョンにアップデートする手順を案内します。最新のエージェントをダウンロードし、アプリケーションサーバーを再起動してアップデートを適用する方法が含まれます。また、安定的なシステム終了のためのアプリ終了、エージェントのJARファイル変更、アプリ開始の順番に従ってアップデートする手順が確認できます。","permalink":"/ja/java/update-agent"},{"id":"java/install-agent","title":"エージェントのインストール","description":"WhaTapのJavaアプリケーションモニタリングエージェントのインストール手順を詳しく説明します。この文書では、エージェントのダウンロードとインストール、構成ファイルおよびエージェントの設定方法を案内します。","permalink":"/ja/java/install-agent"},{"id":"java/topology-settings","title":"エージェントのオプション設定","description":"トポロジー機能を利用するためにエージェントにオプションを適用する方法を提供します。","permalink":"/ja/java/topology-settings"},{"id":"java/agent-log","title":"エージェントログの設定","description":"Javaアプリケーション環境で発生するログデータをエージェントを通じて管理する方法を案内します。ログファイルのパスと名前の設定、保存期間の設定、ログのモニタリング、ユーザー定義型のログ追跡の活性化方法などが含まれます。ログ管理のための様々な設定オプションを提供し、システムの効率的なログ管理をサポートします。","permalink":"/ja/java/agent-log"},{"id":"java/agent-weaving","title":"オープンソース追跡","description":"Javaアプリケーションで使用するフレームワークやオープンソースライブラリをエージェントを介して追跡する設定方法を提供します。 Javaエージェント設定ファイル(whatap.conf)にweavingオプションを追加して設定し、様々なフレームワーク及びライブラリバージョンに対応する方法を案内します。","permalink":"/ja/java/agent-weaving"},{"id":"java/cube","title":"キューブ","description":"キューブについて説明します。","permalink":"/ja/java/cube"},{"id":"java/supported-spec","title":"サポート環境","description":"WhaTap Javaエージェントの対応環境に関する詳細情報を提供します。Java 6以降で20以下のすべてのOSにおいて、JVMで駆動されるアプリケーションに対する対応情報、Java 1.5以下のバージョンに対する制限的な対応、対応OS、アプリケーションサーバー、フレームワーク/ライブラリ、およびデータベースの一覧が含まれます。","permalink":"/ja/java/supported-spec"},{"id":"java/script-plugin","title":"スクリプトプラグイン","description":"Javaエージェントが提供するプラグインオプションを通じて、ユーザーが希望するコードをトレースデータに注入するか、メソッド実行前後に付加情報を追加する方法を提供します。メソッドの開始/終了時点で特定のコードを実行する場所を設定するオプションと、ユーザー定義型poolをモニタリングするためのクラス設定方法が含まれます。実際のプラグインの適用事例を通じて具体的な活用方法を提示し、モニタリングの柔軟性と細さを高める様々な設定例とAPIの使い方を案内します。","permalink":"/ja/java/script-plugin"},{"id":"java/analysis-apm","title":"スタック","description":"特定の時間帯の呼び出しスタックの頻度とメソッド、トランザクションに関する詳細情報を確認できます。","permalink":"/ja/java/analysis-apm"},{"id":"software-proxy","title":"ソフトウェアプロキシ","description":"モニタリング対象サーバーから外部ネットワークへの直接アクセスを遮断し、単一チャンネルを介して外部接続を許可することができます。","permalink":"/ja/software-proxy"},{"id":"java/topology-type","title":"タイプ別トポロジー","description":"タイプ別のトポロジーが提供するものについて説明します。","permalink":"/ja/java/topology-type"},{"id":"java/dashboard-intro","title":"ダッシュボード","description":"WhaTapモニタリングサービスが提供するJavaアプリケーションモニタリングのダッシュボード機能とこれを通じて得られる情報について案内します。ダッシュボードはプロジェクトの全体現況を一目で把握でき、応答時間、トランザクション状態、システム資源の使用量などをリアルタイムで可視化して提供します。ダッシュボードにより、運用者はサービスの状態を直感的に理解し、障害を即座に認識できます。","permalink":"/ja/java/dashboard-intro"},{"id":"java/topology","title":"トポロジー","description":"モニタリング対象サーバーから収集されたリアルタイムの情報により、アプリケーションサーバー間の相関関係を容易に理解できます。","permalink":"/ja/java/topology"},{"id":"java/agent-toplogy","title":"トポロジーマップ","description":"Javaエージェントが収集したデータを使用してアプリケーションのトポロジマップを作成するエージェント設定オプションを案内します。トランザクション呼び出し者、データベース接続情報、HTTPCアウトバウンド情報、アクティブトランザクション状態などの様々な指標により、システムのトポロジを可視化し、分析できます。","permalink":"/ja/java/agent-toplogy"},{"id":"java/agent-transaction","title":"トランザクション","description":"Javaアプリケーション内の各トランザクションの性能データをエージェントが追跡し分析できる設定方法を案内します。トランザクションのリクエスト処理、応答時間、リソース使用量などを追跡して、アプリケーションの性能を評価します。","permalink":"/ja/java/agent-transaction"},{"id":"java/track-transactions-intro","title":"トランザクション","description":"トランザクションの概要を示します。","permalink":"/ja/java/track-transactions-intro"},{"id":"java/trs-view","title":"トランザクション分析","description":"トランザクション関連のメニュー画面を案内します。","permalink":"/ja/java/trs-view"},{"id":"java/tx-profile","title":"トランザクション検索","description":"個々のトランザクションの性能属性に基づいて、目的のトランザクションを検索できます。","permalink":"/ja/java/tx-profile"},{"id":"java/agent-transaction-error-stack","title":"トランザクションエラースタック","description":"Javaアプリケーションでトランザクション中に発生するエラーを感知し、これに対するスタックトレースを表示するエージェント設定オプションを案内します。 トランザクション、メソッド、SQL、HTTP呼び出し、SOCKET呼び出しなど様々な領域からエラー情報を収集し、エラースタックの長さ、タイトルの長さなどを設定する方法が含まれます。 エージェント設定によりエラー管理を改善し、アプリケーションのエラー診断をより効率的に行えるようにサポートします。","permalink":"/ja/java/agent-transaction-error-stack"},{"id":"java/collect-stacks","title":"トランザクションステップの収集方法","description":"トランザクションステップの収集方法を説明します。","permalink":"/ja/java/collect-stacks"},{"id":"java/trs-profile","title":"トランザクショントレーシング","description":"アプリケーションで詳細なトランザクションプロファイリングを構成する方法を案内します。トランザクションプロファイリングにより、ユーザーはアプリケーション内の個々のトランザクション性能データを収集して分析でき、これにより、アプリケーションの性能を向上させるのに役立ちます。","permalink":"/ja/java/trs-profile"},{"id":"java/trs-endpoint-setting","title":"トランザクションのエンドポイント設定","description":"トランザクションのエンドポイント設定について説明します。","permalink":"/ja/java/trs-endpoint-setting"},{"id":"java/add-jvm-opt/batch-app","title":"バッチアプリケーション","description":"WhaTapのJavaエージェントをバッチアプリケーションに適用する方法を案内します。バッチアプリケーションの独特な開始をはじめ中止の繰り返し動作によるウェブアプリケーションとの違いを説明し、必要なエージェントのダウンロード、エージェントとバッチホストの構成、エージェントと一緒にバッチ作業の実行、time_limit設定などを通じた実行時間のモニタリング方法を提供します。","permalink":"/ja/java/add-jvm-opt/batch-app"},{"id":"best-practice-guides/about-apm-heap-memory","title":"ヒープメモリメトリクス通知設定","description":"WhaTapアプリケーションモニタリングのヒープメモリ関連指標とメトリクス通知設定について案内します。","permalink":"/ja/best-practice-guides/about-apm-heap-memory"},{"id":"java/analysis-hitmap","title":"ヒットマップ","description":"アプリケーションで、詳細なトランザクションプロファイリングを構成する方法を案内します。 トランザクションプロファイリングにより、ユーザーはアプリケーション内の個々のトランザクション性能データを収集して分析することができ、これにより、アプリケーションの性能を向上させるのに役立ちます。","permalink":"/ja/java/analysis-hitmap"},{"id":"java/dashboard-hitmap-trace","title":"ヒットマップ-トレース分析","description":"Javaモニタリングでアプリケーションダッシュボードのヒットマップウィジェットを通じてトランザクションとその下位ステップの情報を一目で分析する方法を案内します。 ユーザーは、希望する領域をドラッグして、選択した領域のトランザクション一覧と詳細ステップ情報を含む分析ウィンドウを確認できます。 これにより、エラーが発生したトランザクション情報を分類し、トランザクションの性能を詳細に分析できます。","permalink":"/ja/java/dashboard-hitmap-trace"},{"id":"java/install-agent-with-buildpack","title":"ビルドパックを使用したJavaエージェントのインストール","description":"ビルドパックを使用してJavaエージェントをインストールする方法を説明します。","permalink":"/ja/java/install-agent-with-buildpack"},{"id":"java/metrics-detect-anormal","title":"マトリックス異常検出","description":"さまざまなメトリクス指標のパターンをAIが学習した予想パターンと比較できます。","permalink":"/ja/java/metrics-detect-anormal"},{"id":"java/trs-multi-trace","title":"マルチトランザクション","description":"マルチトランザクション追跡について案内します。","permalink":"/ja/java/trs-multi-trace"},{"id":"java/analysis-trace-mtx","title":"マルチトランザクショントレース","description":"システム内またはシステム間で発生するさまざまな呼び出し関係を一目で確認でき、どのような問題が発生したかを識別して改善できるようにトランザクションとトレース情報を提供します。","permalink":"/ja/java/analysis-trace-mtx"},{"id":"java/learn-apm-main-menu","title":"メインメニュー","description":"アプリケーションモニタリンサービスの主なメニューについて説明します。","permalink":"/ja/java/learn-apm-main-menu"},{"id":"java/metrics-intro","title":"メトリクス","description":"メトリクスの概要について説明します。","permalink":"/ja/java/metrics-intro"},{"id":"java/metric-warning-notice","title":"メトリクスアラートの通知","description":"特定の複雑なイベントを設定するには、メトリクスイベント設定を使用します。","permalink":"/ja/java/metric-warning-notice"},{"id":"java/flexboard-metric-widget","title":"メトリクスウィジェット","description":"プロジェクトの性能指標を表すメトリクスデータをウィジェット形式でダッシュボードに追加する方法を案内します。メトリクスはカテゴリで分類され、タグを利用してデータを検索でき、テーブルウィジェットとシリーズウィジェットの2つのタイプで提供します。","permalink":"/ja/java/flexboard-metric-widget"},{"id":"java/agent-number-of-user","title":"ユーザー数","description":"Javaウェブアプリケーションサーバーに接続されたユーザー数をエージェント設定を通じて集計する方法を案内します。リアルタイムのユーザー集計の活性化有無の設定、ユーザー数を集計するためのクッキー制限設定、IPアドレスまたはHTTPヘッダーの特定値に基づいたユーザーの集計方法、クライアントIP情報追跡のためのHTTPヘッダー設定などを含みます。","permalink":"/ja/java/agent-number-of-user"},{"id":"java/labs","title":"ラボラトリー","description":"ユーザーに、新しい機能や実験的な機能を提供するメニューの実験室について案内します。","permalink":"/ja/java/labs"},{"id":"java/report-intro","title":"レポート","description":"レポートについて説明します。","permalink":"/ja/java/report-intro"},{"id":"java/set-event-log","title":"ログ警告通知","description":"ログメッセージをフィルタリングして、警告通知を設定できます。","permalink":"/ja/java/set-event-log"}],"unlisted":false}}');

